import React from 'react';
import NavBar from '../components/NavBar';
import TopBar from '../components/TopBar';

const HomePage = () => {
	return (
		<>
			<TopBar />
			<img src='./blessed-bites-high-resolution-logo-transparent.png' alt='logo' className='h-24 items-center' />
			<div>Hello welcome to Blessed Bites!</div>
		</>
	);
};

export default HomePage;
